import * as React from 'react';
import {Dimensions,TouchableOpacity, Text, View, StyleSheet } from 'react-native';
import Constants from 'expo-constants';
import {Calendar} from 'react-native-calendars';
import moment  from 'moment';
const CUSTOM_WIDTH = Dimensions.get('window').width;
import {LocaleConfig} from 'react-native-calendars';

LocaleConfig.locales['en'] = {
    monthNames: ['January','February','March','April','May','June','July','August','September','October','November','Décember'],
    monthNamesShort: ['Jan.','Feb.','Mar','Apr','May','Jun','Jul.','Aug','Sept.','Oct.','Nov.','Dec.'],
    dayNames: ['Monday','Tuesday','Wednesday','Thursday','Friday','Saturday','Sunday'],
    dayNamesShort: ['Mon.','Tue.','Wed.','Thur.','Fri.','Sat.','Sun.'],
    today: 'Today\'now'
};

LocaleConfig.locales['ru'] = {
    monthNames: ['Январь','Февраль','Март','Апрель','Май','Июнь','Июль','Август','Сентябрь','Октябрь','Ноябрь','Декабрь'],
    monthNamesShort: ['Янв.','Феб.','Март','Апр','Май','Июнь','Июль.','Авг','Септ.','Окт.','Нов.','Дек.'],
    dayNames: ['Понедельник','Вторник','Среда','Четверг','Пятница','Суббота','Воскресенье'],
    dayNamesShort: ['Пн.','Вт.','Ср.','Чт.','Пт.','Сб.','Вс.'],
    today: 'Сегодня\'hui'
};

LocaleConfig.defaultLocale = 'ru';

export default class App extends React.Component {
    state={
      selectedDate: '',
      markedDates: {}
    }
    
  render() {
    const getSelectedDayEvents = (date) => {
        let markedDates = {};
        markedDates[date] = { selected: true, color: '#00B0BF', textColor: '#FFFFFF' };
        let serviceDate = moment(date);
        serviceDate = serviceDate.format("DD.MM.YYYY");
        this.setState({
            selectedDate: serviceDate,
            markedDates: markedDates
        });
    };
    return (
      <View style={styles.container}>
        <View style={ styles.calendarBox}>
          <View style={styles.topHeaderCalendar}>
            <Text style={styles.topHeaderCalendarText}>C {this.state.selectedDate}</Text>
          </View>
          <Calendar
                style={{height: 300,width: '90%', justifyContent: 'center'}}
                          theme={{
                              backgroundColor: '#ffffff',
                              calendarBackground: '#ffffff',
                              todayTextColor: '#57B9BB',
                              dayTextColor: '#222222',
                              textDisabledColor: '#d9e1e8',
                              monthTextColor: '#57B9BB',
                              arrowColor: '#57B9BB',
                              textDayFontWeight: '300',
                              textMonthFontWeight: 'bold',
                              textDayHeaderFontWeight: '500',
                              textDayFontSize: 16,
                              textMonthFontSize: 18,
                              selectedDayBackgroundColor: '#57B9BB',
                              selectedDayTextColor: 'white',    
                              textDayHeaderFontSize: 8}}
                          minDate={'1996-05-10'}
                          maxDate={'2030-05-30'}
                          monthFormat={'MMMM yyyy '}
                          markedDates={this.state.markedDates}
                          scrollEnabled={true}
                          horizontal={true}
                          showScrollIndicator={true}
                          disableMonthChange={true}
                          onDayPress={(day)=>{
                              getSelectedDayEvents(day.dateString);
                                }
                            }
                          />
                   
                        <View style={styles.calendarButtonViewStyles}>
                        <TouchableOpacity
                            style={styles.cancelButtonStyle}
                        >
                            <Text style={styles.cancelTextStyle}>Отмена</Text>
                        </TouchableOpacity>

                        <TouchableOpacity
                            style={styles.okButtonStyle}>
                            <Text style={styles.okTextStyle}>Ок</Text>
                        </TouchableOpacity>
                    </View>
            </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'rgba(52, 52, 52, 0.8)',
    padding: 22,
    justifyContent: 'center'
  },
  calendarBox:{
      width: '100%',
      backgroundColor: 'white', 
      justifyContent: 'center', 
      alignItems: 'center',
      borderRadius: 10,
      elevation:4,
      shadowColor: "grey",
      shadowOpacity: 0.5,
      shadowRadius: 10,
      
    },
  topHeaderCalendar:{
      height: 74,
      width: '100%',
      borderTopLeftRadius:10,
      borderTopRightRadius:10,
      backgroundColor: '#32B2EC',
      flexDirection: 'row', 
      justifyContent: 'center',
      alignItems: 'center',
  },
  topHeaderCalendarText:{
      fontSize: 24,
      color: '#ffffff',
      lineHeight: 29,
      fontWeight: 'normal',
      fontStyle: 'normal,'
  },
  calendarButtonViewStyles:{
        width: '100%',
        height:80,
        alignItems:'center',
        justifyContent: 'space-between',
        paddingHorizontal: 32,
        borderBottomLeftRadius:10,
        borderBottomRightRadius:10,
        flexDirection: 'row',
        backgroundColor:'#fff'
    },
    cancelButtonStyle:{
        width: 118,
        height: 40,
        borderWidth:1,
        borderRadius: 100,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#fff'
    },
    cancelTextStyle:{
        fontSize: 14,
        color: '#222222',
        lineHeight:17,
        fontStyle:"normal",
        fontWeight:"normal"
    },
    okButtonStyle:{
        width: 118,
        height: 40,
        borderRadius: 100,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#57B9BB'
    },
    okTextStyle:{
        fontSize: 14,
        color: '#fff',
        lineHeight:17,
        fontStyle:"normal",
        fontWeight:"normal"
    },
   
});
